import React,{ useEffect, useState } from "react";
// import { Link } from "react-router-dom";
import axios from 'axios';

function Form() {

    // const [team, setTeam] = useState();
    const dd ='';

    const teamdata = async() =>{
        const dd = await axios.get('/api/team');
        console.log(dd.data);
        dd.push(dd.data)
    }

    useEffect(() => {
        document.title = 'from';

        teamdata();
    },[]);

    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <h1>from</h1>
        </>
    )
}

export default Form
